import React from 'react'
import {PhotoAlbum} from 'styled-icons/material-outlined';


import {
    Container,
    Body,
    Content,
    Texto,
    Button,
    Bottom,

  } from './styles';

const Input : React.FC = () =>  {
    return (  
        <Container>
            <Body>
                <Content>
                    <Texto>
                        <textarea placeholder="Criar um evento"/>
                    </Texto>

                    <Bottom>
                        <PhotoAlbum className='iconPhoto'/>
                        <Button>
                            <span>Postar</span>
                        </Button>
                    </Bottom>
                </Content>
            </Body>
        </Container>

    );
};

export default Input;
